import React, { Component } from "react";
import "./style.css";
import {Home} from "../../pages/Home";

export const Row = props => (
  <>
    <tr>
      <td>
        <img src={props.image} alt={props.name} />
      </td>
      <td>{props.name}</td>
      <td>{props.phone}</td>
      <td>{props.email}</td>
      <td>{props.dob}</td>
    </tr>
  </>
);




class EmployeeTable extends Component {
    constructor() {
        super(); 
        this.state ={
            employees: [
                {
                    image: "https://vignette.wikia.nocookie.net/spongebobgalaxy/images/0/07/SpongeBob_SquarePants.png/revision/latest?cb=20171228024014",
                    name: "Chris",
                    phone: "215 555 2222",
                    email: "Chris@chris.com",
                    dob: "10/12/1993"
                },
                {
                    image: "",
                    name: "Chris",
                    phone: "215 555 2222",
                    email: "Chris@chris.com",
                    dob: "10/12/1993"
                },
                {
                    image: "",
                    name: "Chris",
                    phone: "215 555 2222",
                    email: "Chris@chris.com",
                    dob: "10/12/1993"
                },
                {
                    image: "",
                    name: "Chris",
                    phone: "215 555 2222",
                    email: "Chris@chris.com",
                    dob: "10/12/1993"
                },
            ],
            search: ""
        }
    }

  render() {
    return (
      <table>
        <tr>
          <th>Image</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {this.employees.map(person => (
          <Row {...person} />
        ))}
      </table>
    );
  }
}

export default EmployeeTable;
